description:
Cirque Du Soleil Big Top

Sociopolitical Documentary hosted by Matt Rogers, published by Discovery Channel broadcasted as part of DC Really Big Things series in 2007 - English narration


Information
------------------------------

Matt Rodgers helps to put up Cirque Du Soleil's big top; shoots the rapids at the U.S. National Whitewater Center to train Olympic kayakers, and assists the Navy in moving a fleet of Hummers via one hovercraft.

